import React, { Component } from "react";
import "./Program.css";

class Program extends Component {
  render() {
    return (
      <div className="pro-body">
        <style>{"body { background-color: #281C61; }"}</style>

        <div className="pro-top">
          <div className="Word-title">
            <p>
              데놀의 꽃<br />
              <strong>프로그램</strong>
            </p>
          </div>
        </div>
      </div>
    );
  }
}
export default Program;
